const ChoiceList = (props) => {
    const choices=props.choices;
    var choiceElement=choices[1];
    console.log(choiceElement.key)
    return ( 
        <div className="choice-list" >
            <h2>{choiceElement.title}</h2>
            <button>{choiceElement.choice1}</button>
            <button>{choiceElement.choice2}</button>
        </div>
     );
}

export default ChoiceList;
